import React from "react";
import messagesList from "../data/messagesList";
import { READ, UNREAD } from "../constants";

function Email() {
    return (
        <div className="email">
            <ul>
                {messagesList.map((message) => {
                    <li key={message.id}>
                        {message.title}
                    </li>
                })}
            </ul>
        </div>
    )
}

export default Email;
